Share
Save','','','','www.airbnb.com/rooms/762632213174916471','762632213174916471','Enjoy your morning coffee gazing towards an unobstructed forest view.   Nature pours through every window. The Peaceful Modern has been renovated to be open, spacious, and full of light. Step inside and feel relaxation wash over you.  Spend the day enjoying the charm of Lake Arrowhead, hiking the trails,  or curling up with a book next to the fireplace.  At night, prepare a meal in the well-appointed fully stocked gourmet kitchen.  Only a 10-minute drive to Lake Arrowhead village.

The space
The lofted queen bedroom with vaulted ceilings has the best views in the cabin - wake up to a serene view of trees.  There is also a well equipped desk and work station on this scenic level.  

The main level and downstairs bedrooms have luxuriously-sized king beds and en suite bathrooms attached. Folding memory foam twin mattresses are available upon request - perfect for kids. 

The spacious, renovated kitchen has new designer appliances and everything you need to cook a delicious meal or prepare the perfect cup of coffee. Sliding doors open onto a deck outfitted with a Weber gas grill with easy access off the kitchen.  The main deck includes an outdoor dining table that seats 6 comfortably.

The cabin has all the necessary elements for a peaceful retreat yet all the modern convenience, including fast WiFi, a flatscreen smart TV, a Sonos sound system, and central heat and A/C.

** Please note: It snows in Lake Arrowhead and chains are REQUIRED on steep mountain roads.  If you''re booking in winter, please be prepared for snow.

Guest access
All parts of the house in the space is yours to enjoy.  One closet is locked for owner''s personal items.

Other things to note
POWER - In the event of power outage there is a Generator next to shed that will power the entire property. If there is a power outage, the generator will begin running within 10 seconds. Instructions will be provided.

WINTER SNOW SEASON - During the winter snow season Lake Arrowhead can see a very large snow accumulation. 4 wheel drive vehicles are recommended and carrying snow chains with you is a must. We have a plow service that comes every snowfall (of 6 inches or more) to clear the roads and a shoveling service to clear pathways prior to your arrival.

Registration number
CESTRP-2022-01784
