Save','','','','www.airbnb.com/rooms/1324965150846314034','1324965150846314034','About this place
Freshly renovated smart home with TONS of space. Our home''s lot is 16,000 sq ft on a hill overlooking San Jose with miles of hiking preserve behind us and a lake 10 min away. 

We''re 8 min away from a variety of shops, restaurants, and places to have fun. 

You''ll have a large, private, bedroom and bathroom stocked with everything you''ll need. You can access a washer/dryer, a private fridge, and our huge backyard.

We have a friendly golden retriever who will greet you when you come in!

The space
A 16,000 sqft lot with 4 bedrooms and 2 bathrooms. This open-concept house has a really comfortable living room where you can use an 83" OLED TV to watch whatever you like! We have almost every streaming service available for you. 

Everything is freshly renovated. You are free to use our kitchen, backyard, patio, etc. We have a friendly golden retriever that loves to cuddle and play.

