Save','','','','www.airbnb.com/rooms/717966526602141717','717966526602141717','Escape to your private 55+ resort retreat! This cozy, remodeled travel trailer with an Arizona room offers all the comforts you need. Enjoy heated pools, hot tubs, and a gym in a serene resort environment. Perfect for business travelers, medical tourists, or those seeking a quiet getaway. Conveniently located near medical facilities, historical sites, and local attractions, this space offers the ideal spot to relax and recharge.

The space
This 300 sq ft remodeled travel trailer features twin beds, a kitchenette, and a relaxing Arizona room with reclining chairs, a SmartTV with streaming apps, and a small bar. Designed for guests 55 and over, this space blends vintage charm with modern amenities. The compact layout offers a cozy yet functional setting, perfect for short stays or longer visits, with everything you need to feel right at home.

Explore the vibrant Yuma area with ease. You''re just:
• 2.5 miles from Yuma Regional Medical Center
• 5 miles from Yuma Territorial State Prison Historical Park and Historic Downtown Yuma
• 5.5 miles from Cocopah Casino
• 6.2 miles from Paradise Casino
• 13 miles from Algodones, Mexico

Guest access
Guests have full access to the entire travel trailer and Arizona room, as well as all resort amenities including two heated pools, two 24-hour hot tubs, a gym, billiards, and shuffleboard. Onsite parking is available near the front door for your convenience. The peaceful resort atmosphere offers a quiet environment to relax, and nearby attractions such as medical facilities, parks, and historic sites make it a great base for exploring.

Other things to note
Non-aggressive small pets are welcome. The space is ideal for individuals, couples, or business travelers. There may be occasional low-flying fighter jets from the nearby US Marine Corps Air Station—they are spectacular to watch and earplugs are provided if needed. Enjoy your peaceful retreat with all the amenities for a relaxing and comfortable stay.
