	 ('0b333509-600e-4949-85c9-611ae5bca982'::uuid,'2025-02-15 21:05:31.353158+00','','A-Frame in the Clouds
Share
Save','','','','www.airbnb.com/rooms/694428490572677669','694428490572677669','Bailes Farm was chosen 2nd best glamping destination in the U.S. by Hipcamp in 2023.  
Remote A-Frame off-grid cabin with expansive ocean and mountain views.  On a clear day, enjoy an expansive view of the Pacific Ocean.  The A-Frame is located in a former avocado grove that is slowly being re-established with diverse permaculture. Everything is provided for cooking and eating, as well as a hot shower and composting toilet.  The bed will be made for you with clean bedding.

The space
The A-Frame is built on a large deck with about 300 square feet.  The walls and ceiling are constructed of 2x6 lumber and canvas stretched over it and metal roofing. There is a Cal King sized bed, plus a twin xl bed in the loft.  Additional space for a fourth guest on a large comfortable leather sofa. Propane is provided for the gas grill, shower, portable space heater and gas fire-pit on the back deck.  

The kitchen has a mini-fridge with a freezer, sink, and all the basic cooking supplies: pots and pans, spatula, cups, plates, and silverware. Trash bins are available with extra trash bags if needed. We also offer free Starbucks coffee and tea. 

There is a composting toilet made out of a rustic wine barrel. The shower has on demand hot water. It is always stocked with body wash, shampoo, towels, and washcloths. 

Wake up with some morning coffee or tea to this incredible view of the ocean and mountains. There is lots of wildlife to see such as red tailed hawks who love to fly right above and dive around the hills. You will also see lots of hummingbirds and an occasional golden eagle. We also have had rare sightings of little bobcats and coyotes, but don''t worry they are harmless to humans.
Bailes Farm is an 80-acre property in northern San Diego county, nestled between the greater metropolitan areas of Los Angeles-Orange County and San Diego. From the property there are expansive views of the entire coastline of San Diego, as well as views of the snow capped peak of Southern California’s highest mountain, San Gorgonio, at 11,503 ft.
Located just 12 miles from the Pacific Ocean, the property’s climate is moderated by a gentle breeze from the ocean. The farm is situated on a miniature mountain that rises up 1,500ft above the nearby valley, not only creating a spectacular vantage point, but also a unique microclimate resulting from ocean moisture condensing as it’s forced to rise.  The moisture nourishes a 20 acre avocado grove, in addition to 60 acres of native chaparral, which features a healthy population of the beautiful Manzanita tree, an endangered species protected by law.
The nearby Santa Margarita River Preserve minutes away provides hikers with access to an extensive hiking network along the river. The larger area is shielded from development and highways by the Cleveland National Forest. There is no traffic noise, and the air is the cleanest in Southern California.

Guest access
