Save','','','','www.airbnb.com/rooms/710092666168276467','710092666168276467','Our 3 Bedroom 3 Bath 2-story home is perfect for your family with up to 8 guests. With no boardwalk to obstruct your view you can walk directly onto the sand or spend time enjoying our Oversized Patio & Balcony equipped with outdoor dining, lounge chairs, BBQ and outdoor fire-pit! 

