The space
Home professionally managed by Tower 17 Properties located in Newport Beach CA


This absolutely Beautiful Oceanfront Single family Home is located on 52nd St. This home has one of the closest proximity to the ocean in all of Newport Beach. 

Bedroom 1 - (1) King-sized bed with En-Suite Bathroom (tub/shower)
Bedroom 2 - (2) Bunk beds (4 Single Beds) with Adjacent Hallway Bathroom (Tub/Shower)
Bedroom 3 - (1) Queen-sized bed with Adjacent Hallway Bath (shower) - Bedroom (3) is on the ground level should anyone in your group have mobility issues. 

Other amenities include -Washer/Dryer, WiFi, Local Cable, Linens, Beach & Bath towels, Dining Area, (2) Outdoor dining tables. Our Kitchen is Fully Equipped with pots, pans, dishes, coffeepot, Gas BBQ, Beach Toys & Beach Chairs


HOME LOCATION
For those of you looking to enjoy a QUIET Vacation you have found the right place. 

West Newport is (in our opinion) the best locations to live/rent in Newport Beach. With the bike path located in the street (Unlike on the oceanfront in other areas) there is nothing to obstruct your view directly from the living room to the ocean! West Newport (52nd to 74th) is home to many long term residents spending time enjoying the beach without all of the hustle and bustle of the Pier/Tourist Areas. Inclusive of the West Newport Park you will find everything from children''s Jungle Gyms, Racketball, Pickle Ball, Tennis, Volleyball, and basketball courts.   

Although you may be looking for a quiet getaway, the action is never more than a Walk/Bike Ride away. (2-15 Minutes by Bike) 20+ Restaurants, Bars, Coffee Shops, Surfboard/Bike rental shops, Grocery Store, Duffy Boat Rentals, Newport Pier etc. (15-30 Minutes by Bike) Balboa Pier, Balboa Fun Zone, Balboa Island, Boat Docks (The Catalina Express, Whale Watching Tours, and Sailing Adventures) Huntington Beach Pier/Pacific City,  and much more! 


