	 ('bd0a8d24-d416-4646-804c-5a41ed78d127'::uuid,'2025-03-09 18:34:11.80451+00','','Stylish Midcentury Home with Stunning Backyard
Share
Save','','','','www.airbnb.com/rooms/5870057','5870057','A truly gorgeous, ultra-private classic midcentury home curated with a mix of vintage and modern pieces. It''s got one of the best yards in Palm Springs with total privacy, a large pool, spa, mountain views, pergola, built-in grill + gorgeous landscaping. Walls of glass blur the inside + outdoors, giving the home a stunning backdrop. I take great pride in making sure the house is absolutely perfect & being available for my guests. My reviews say it all!  Available for shoots. CITY ID#1830

The space
This absolutely fabulous light and bright mid-century, post-and-beam classic 2,250-square-foot home is as private as you can get and features walls of glass facing the huge backyard, pool, and spa. This is a simply stunning home that exemplifies classic mid-century architecture and indoor/outdoor living and entertaining. It''s a quintessential Palm Springs compound!

Inside is a gourmet kitchen, a giant living room, three bedrooms (two with direct access to yard), and two and a half baths. Outside, there''s an absolutely amazing fenced and gated private backyard with fantastic mountain views, two outdoor fireplaces, a large pool that can be heated for an additional fee with an in-ground spa/hot tub and cascading waterfalls surrounded by lush landscaping and an awesome, shaded steel pergola lounge area with firepit and overhead dimmable lighting. A great hangout night or day! There''s also a  new outdoor kitchen with built-in high-end gas grill, gas burner, lots of counter space, lighting, sink, spray faucet, and kitchen storage.  One of our favorite features is the luxurious open-air rainfall outdoor shower. The desert-lanscaped front yard also includes a seating area and more mountain views. 

We recently put in stunning, brand-new terrazzo-style floors (throughout the entire house, including the bedrooms) and new quartz countertops in the kitchen. They look amazing!

The home is decorated in true mid-century style with a curated mix of new and mid-century vintage pieces. Design and architecture buffs will love it (but so will everyone else). 

Deepwell is one of Palm Springs'' most sought-after neighborhoods full of gorgeous mid-century homes and a short walk to South Palm Springs businesses. Downtown is a quick drive, bike ride, Buzz or Uber away!

PLEASE NOTE that a city-required 12.5% occupancy tax is added to the reservation by Airbnb
If you opt for OPTIONAL pool heat, a fee of $85/night (November-March) will be added to the reservation via special offer and $75/night all other months.  Unlike at most rental homes, spa heat is complimentary. Hooray!!!

EVEN MORE HOME DETAILS:
Multiple sliding glass doors throughout the home connect the bright living room and kitchen as well as master bedroom and one of the guest rooms to the yard, complete with a covered outdoor dining area, and dining table.

All bedrooms face the back or side yard as does the kitchen and living area. Only clerestory windows face the front of the home, which allows plenty of light but also allows for complete privacy. The home is truly an oasis. 

The impeccably kept home is located in the luxurious (and wind-free!!) South Palm Springs neighborhood of Deepwell, close to downtown shops, restaurants, bars, and casino in the heart of downtown Palm Springs. 

The kitchen is full of all stainless appliances (including a wine fridge), and  cookware ready for plenty of cooking for dinners under the stars. Two of the bedrooms have queen beds (with shared full bath) one with sliding glass doors to the yard, while the master bedroom has a king bed, attached full bathroom and sliding glass doors leading out to the backyard. Home also includes a few light weights, yoga mats, and bands which can be used for a backyard workout.

The home comes fully stocked with linens, bath and pool towels, all kitchen accessories and appliances as well as a gas grill for outdoor grilling. You also have access to wireless Internet, a flat-screen TV,  Apple TV, Sonos speakers indoors,, vintage stereo system including a turntable and killer vinyl collection with over 125 titles, Nest thermostat system, Philips Hue lighting, H/E washer dryer, and a two-car garage.

Featured on the Fall 2017 Modernism Week Framed Spaces Tour. 
AVAIL FOR PRINT, TV, FILM & WEB SHOOTS. PLEASE INQUIRE.

Guest access
Everything!

Other things to note
PLEASE NOTE that a city-required 12.5% occupancy tax is added to the reservation by Airbnb. If you opt for OPTIONAL pool heat, a fee of $85/night (November-March) will be added to the reservation via special offer and $75/night all other months.  Unlike at most rental homes, spa heat is complimentary. Hooray!!!


All guests must be 25 years or older. Any guests under 25 must be accompanied by parent or legal guardian. We are unable to book with guests who have not received any verified host reviews on Airbnb. 
CITY ID# 1830

By booking our home for a stay, you agree to comply with the below house rules in their entirety.  

•	No smoking by anyone anywhere in the house or in the backyard.  We collect vintage ashtrays simply for purposes of vintage décor – not for smoking.  If you wish to smoke, please smoke in the front desert-scape yard away from the house, and discard your trash in the outside city garbage can. 

•	No loud amplified music. (Palm Springs city ordinance states that no outdoor amplified music is allowed to be played by renters at any time, day or night). We understand that that is a ridiculous ordinance but If neighbors can hear it in their yard, it is too loud and they will likely call the police/hotline. As of March 15, 2017, Audible music at the property line is now punishable with a $500 fine by the city, which is fined to the guest.

•	No engaging in loud outdoor activities on the premises so as to create a nuisance to any persons residing on properties surrounding our property. Again, reasonable outdoor activities are fine. Please be respectful of our neighbors. As of March 15, 2017 noise from property that exceeds 40 decibels after 10pm at the neighboring property line is punishable with a $500 fine by the city, which is fined to the guest.

•	You will be responsible for any and all fines assessed to the owners resulting from your or your guests actions, including and without limitation resulting from city agency citations during rental period, and you acknowledge and agree that we have the right to apply your security deposit to any such amounts.

•	No more than six (6) adult occupants overnight or eight (8) daytime occupants on the premises total.

•	No commercial usage of the premises, including for purposes of filming, photography or other content production, without making prior arrangements with owners.  We charge an extra fee for commercial usage. 

•	Engaging in any illegal activity, including the use of illegal drugs, on the premises is strictly prohibited.

•	No pets (including emotional support animals) allowed on the premises without our approval. If you bring a pet without first obtaining our approval, you agree to an additional pet fee of $100 per night. If you’ve been approved to bring a pet, we welcome your dog to Mod Mesquite, but while you are here, the following rules apply:

o	Please do not allow your dog to urinate on the grass in the backyard; steer him or her to the rocks or anywhere in the front yard where it is entirely sand/desertscape. We really appreciate your cooperation with this – and so do our future guests!
o	If your dog relieves itself on the grass, please clean it up immediately by soaking the area with water from the hose around the side of the house to minimize damage to grass. We really appreciate your cooperation with this – and so do our future guests!
o	Please don’t allow dogs on any of the furniture or beds.
o	Please clean up after your dog prior to checking out.
o	Please inform us immediately (prior to checkout) if your dog causes any damage.

Registration number
City ID 1830
