Save','','','','www.airbnb.com/rooms/25518501','25518501','Relax and enjoy nature at our beautiful, tranquil, lovingly remodeled A-frame cabin, now with a brand new master suite and sunroom! Within walking distance from the center of town, it''s perfectly situated on a quiet street amongst the trees, buzzing with blue jays and hummingbirds. Curl up by the fireplace and enjoy surround-sound tunes, or have a spa-like soak after hitting the nearby trails. As a creative couple ourselves, we designed this space for romantic getaways and creative retreats.

The space
We built this home with creativity in mind. So if you’re looking for a place to be creative in nature, look no further. 

*We newly installed AC & heating throughout the cabin.

Other things to note
- PLEASE NOTE: the staircases are steep and the staircase to the upper level has railing on only one side.

- We allow a maximum of TWO well-behaved pets. To help cover pet-related cleaning costs, there is a PET FEE of $15/pet.

- The classic lofted A-frame bedroom does not have a door. The bedroom next to it does have a door. The master bedroom downstairs has a hatch door you can close for privacy.

- Please note that we have a security Nest camera in the outside front driveway and outside the lower deck doorway. We also have a county mandated outdoor noise monitor on the front deck.

- Our yard is NOT fenced

-QUIET HOURS:
Quiet hours are 10pm - 8pm in respect to our permanent neighbors.

- Only use main paved road to walk into town. Do not access any private roads through the back of the cabin as to not trespass on neighbor''s property. 

- In the warmer months we put up a hammock area on the side of the cabin that you can enjoy.

- On a clear night, the star visibility is incredible. We recommend downloading a stargazing app, sitting on the back deck at night, and enjoying the constellations.

-PERMIT #003350
