Save','','','','www.airbnb.com/rooms/24648225','24648225','You are the only guests in this local icon/extreme dome home. Airbnb Domes are the two largest (32'' diameter) & tallest (32'' high), totaling 2,000+ square feet. In the ring of stone columns, walk the Labyrinth, watch the sun rise & set. Relax in the Great Dome with fireplace, sunken sofas, and grand piano. Rest well within 8" thick walls, in the ensuite Guest Room or up spiral stairs to the Loft. Dine at the kitchenette or Courtyard BBQ, warmed by the wood fire while stargazing. TPT#21263314

The space
Once a "tour home of the future" we are continuing the original mission -- experience this  unique futuristic architecture for yourself, by youself -- we only take one booking, for up to 8 guests, at a time. 
Located near two of Sedona''s most popular vortexes -- Cathedral Rock and Bell Rock, enjoy our woodsy 3.5 acres with cafes, restaurants, upscale grocery store, shops, galleries, spas, bike rental, public golf course and trail heads just around the corner. 
The Sedona Domes is extreme architecture at its most spacious and gracious— 10 soaring cement domes well lit by skylights, bright white interior, and contemporary eclectic hi furnishings. 

Your private guest quarters are the two largest and tallest domes, with your own front door, kitchenette, two bedrooms and bathrooms, and a 1000-square-foot Great Room, and enclosed outdoor courtyard. Plenty of room to spread out, and great photo ops, inside and out!  

Guests'' private, dedicated domes = 2,000+ sq ft
Number of Guest bookings at a time = 1 (it''s only you here) 
Number of Guests in your party = up to 8 
Number of on-site hosts = 2  (owners Laura Lee & Paul, in our private half of the house)

As the only guests your private quarters are two domes with: front entry, kitchenette, two bathrooms and bedrooms, great room, courtyard with BBQ, fire pit, seating. There are locked doors between Host''s half of the ring of domes, and our Guests'' half of the ring of domes. Hosts or Co-Host are on-site, but out-of-sight, to respond to text requests. 

Parking: lots of level, on-site space, can accommodate multiple cars and big rigs. Electric vehicles can charge up at The Collective, it''s within walking distance.

Phone/Internet/TV/DirecTV Satellite/DVD: We have good cell phone reception for most carriers. Strong password-protected, high-speed wi-fi throughout. Two big-screen smart TVs with HDMI outlets. DirecTV Satellite gets many (not all) sports games. DVD player in Great Room. 

What''s In the......
Ground-floor Ensuite Guest Room: Comfy side-by-side queen beds, desk, smart TV. Closet with shelf and extra luggage racks, hangars, extra blankets. Ensuite bathroom with shower/tub, hairdryer, shampoo, conditioner, body wash, towels. 

Loft up the spiral stairs: 1 King bed + 1 Full bed + 1 Twin. Table & chairs.  

Second Bathroom: On ground floor at foot of stairs for those in the loft. Spacious with multiple mirrors and enclosed WC for multiple users, closet space, hangars and full-length mirror so you need not lug uluggage up the stairs. 

Great Room Dome: Groups enjoy the many different things they can do, relaxing in multiple seating areas, while being together. Relax on the sunken sofas around the big screen TV or curl up on the curved sofa around the 8-foot long fireplace. Play cards or games, or dine around at the table and chairs, or plan your hikes and excursions with our three-ring binders full of local things to do and see. 
NOTE Re EXTRA GUESTS: There are two more comfy sturdy twin beds for extra guests, which can be made up in advance upon request. At night, these two beds are afforded privacy (in effect having their own, and largest  “third” bedroom) and the bathroom (shared with whoever in your group is using the loft’s 3beds) is easily accessible. We do have an extra guest fee for guests #7 & #8 beyond the first six. However note that with the two extra beds made up it’s a total of 7 beds (two of which are queen beds) 

Open-Air Courtyard: The fire pit, bistro tables and chairs, lounge chairs, BBQ and outdoor sink. Here you’ll see the courtyard side of the ring of domes that enclose it.  
Rock Column Circle: 10 columns, 7-9 feet tall, enclose a 30-foot diameter circle for yoga, sunrise and sunset viewing, and when installed, walking the labyrinth. 

Kitchenette: Microwave. Toaster. Small fridge/freezer with ice trays. Bar sink. Keurig coffee maker with coffee pods. Electric tea kettle. Tortilla warmer. Rice cooker. Small pancake griddle. Silicone egg cooker. Mugs and glasses, plates, silverware, napkins, trays and serving bowls, trays, and dishes for appetizers. Wine glasses and corkscrews. Cutting board. Ice bucket. 
we provide coffeepods, assortment of herbal and black teabags. Salt, pepper, sugar. 
BBQ: on a wide outdoor counter with sink, shade trellis and lighting. BBQ tools, mits, skewers and interchangeable grill and flat griddle plate.

Well-Water: straight from the aquifer, our 700 foot-deep well water passes all quality tests. 

Pathways: cement pathway leading from the on-site parking area to front door is well lit; there are three steps or use the ramp. 

Provided in bedrooms and bathroom -- Linens, blankets and pillows, towels, shampoo, conditioner, body wash, blow-dryer, makeup remover pads, first aid kit. Iron & ironing board upon request. All beds have new, thick foam mattresses. 

Due to the coronavirus, we’re taking extra care to disinfect frequently touched surfaces between reservations and follow Airbnb''s new cleaning guidelines.

Did we mention all the great photo ops, inside and out, to share with your friends? This is a fun and unique one-of-a-kind home! However, it''s not a set for filming commercially, however it could be with advance arrangements.

Guest access
The two tallest and biggest Domes are yours to enjoy exclusively. Your private front door opens onto your two guest domes. The great dome is the hub for all guest sleeping quarters as well as TV, games and card table, electric fireplace, and kitchenette. 
-- Free guest wifi 
-- Two private Smart big screen TVs with Direct TV, HDMI & DVD 
-- Outdoor enclosed Courtyard with tables and chairs, fire pit, BBQ
-- On Site Parking — large flat lot can accommodate big rigs.
Please note Hosts live and work in other half of this house with lockable privacy doors between their your private guest space and their home. So they are on call to accommodate requests and answer questions.

Other things to note
* Hosts live on the property. Consider them your on-site Concierge. 
* This Airbnb comprises two -- the largest, and the tallest -- of the ten domes of this structure, with its own private and dedicated front door, side door, door to courtyard, great room dome, loft with sleeping quarters, downstairs room with sleeping quarters, kitchenette, and two full bathrooms; a total of over 2,000 square feet.
* We host one guest booking at a time for up to 8 guests of same party. Number of guests registered in your booking must match number in your group. Listing is for 6 with additional guest fee for 7th and 8th guest. 
* Option for two additional beds. Host will make up these beds upon request, for 7 (seven) total beds.
* There''s ample parking for big rigs.
The Collective — a short walk down the sidewalk)  has 14 Tesla Charging stations
* Sorry, no pets due to allergies, no exceptions (though we love animals!)
* Sorry, we cannot host weddings or events as we are not set up for this.
* The HVAC system serves these two domes alone, with fans that can bring in fresh air from the outside. As the walls curve both vertically and horizontally, the windows do not open. If you need open windows, open the sliding glass door with screen. 
* The HVAC system can cool these domes to 72 degrees Farenheit, but not lower due to the huge volume of air the domes enclose. If you need a home that runs cooler, please don''t book these domes.
* The unique features of this dome home is the architecture, the wonderful acoustics, the enclosed courtyard with BBQ and natural wood fire pit for star gazing, and the labyrinth  surrounded by a ring of 9-foot tall natural stone columns. 
* Please note there are a wide range of cafes, restaurants, deli, grocery store and take-out options nearby. the kitchenette has limited cooking options and fridge space. If planning to cook here, please plan your menu around what we have: BBQ has both grill and griddle. Table-top electric appliances available upon request: wok, rice cooker, quesadilla maker. If you need a full kitchen, please do not book.
* No filming or recording for commercial purposes without advance arrangements.
