Share
Save','','','','www.airbnb.com/rooms/25687274','25687274','The lookout is open year round with a wood fired stove to keep warm at night or heat your morning coffee. A wood fired sauna sits below to relax and rejuvenate your body after a big hike or snowshoeing adventure. What''s that other little wooden building? No fire lookout is complete without an outhouse!

The space
Crystal Peak Lookout was built in 1959 and was originally located in Chewelah, WA on top of Stranger Peak. In 1983 it was moved to Northern Idaho to the cedar and tamarack lined slopes of Crystal Peak. Completely remodeled in 2018, Crystal Peak Lookout is now an immersive deep-forest getaway for adventurous couples. Surrounded by 13 wooded acres, you''ll find yourself sharing the sunset view with mountain bluebirds in the tree tops, gazing at the starlit skies while an owl calls from its neighboring perch, and if you''re lucky, waking up to the occasional passing moose.

Guest access
There’s 13 acres to wander around to your hearts content! Depending on the time of year you''ll find huckleberries ripe for the picking, tamarack needles beginning yellow, blue bird boxes full of nestlings, or fresh moose tracks in the snow. You’ll have full access to the lookout, an outhouse & sauna during your stay. Winter is accessed by snowmobile or by a ride in our Polaris razor (the winter wonderland experience)!

Other things to note
You must have a 4WD vehicle to access the lookout. In the winter which can start in late October you’ll need snowmobiles or the equivalent to get to the property. 

Now Available: Winter Wonderland Experience! It''s a rare & absolutely stunning to stay in a lookout in the snow. Our caretakers Bobby and Calandria will greet you in town with gourmet hot cocoa (Baileys optional)  & a Polaris razor. You''ll enjoy breath-taking 360 degree views of the snow covered forest on your way to the lookout. We''ll transport all your gear and food to the lookout and pick you up at the end of your stay. 

It''s a beautiful addition to staying at the lookout. It''s a $100 for the razor ride and we will add that to your booking if you''d like to reserve it. Also your welcome to tip your driver in person if you feel so inclined.
