	 ('dab6962a-1643-42ef-bb5a-dae311496d9d'::uuid,'2025-04-21 16:26:24.07475+00','','DTJT House 1 - SWIM, SOAK & STARGAZE
Share
Save','','','','www.airbnb.com/rooms/45827351','45827351','Welcome to DTJT (Downtown Joshua Tree) your much needed High Desert escape.  Our newly renovated homestead cabins rest on five acres of magical landscape. 

At DTJT you can swim in the 50'' saltwater pool, soak in the hot tub, hike, hang, rekindle, read, stay up, sleep in, stargaze, explore, roast marshmallows, namaste it up, dance it off, soak up the sun, howl at the moon, bbq, feed the road runner, listen to the owl, take an outdoor shower, crush your partner at corn-hole, and yes we have Wifi.

The space
We want you to make DTJT House 1 whatever you want it to be whether you''re coming out for a celebration, escaping city for your nature fix, working in your "desert office space" or soloing it to reconnect with yourself. 

We have created this unique desert getaway so you can feel at home both inside our retro modern cabins or outside in the warmth of the sun and under the starry sky. 

We''re two songs (on the radio) away from town, but secluded enough to where you will be in awe of the epic starry skies and totally feel off the grid. 

 FOR WARM DAYS:
We have an epic swimming pool. It''s big. We''re talking 50 feet long. It''s basically the "mullet" of pools. One side you can totally swim laps so that''s  the "work side." The other side has a tanning shelf and deep end bench which is,  the "play side." The winters are chilly so it''s not exactly swimming temps, but still awesome to sit by to read and hang.  

We have a cover that keeps dirt out and also can warm the pool 10 degrees or so, but the pool is not heated. Ideal swimming time is late April - Nov.

FOR COOL NIGHTS: 
We have a wonderful hot-tub so you can soak those hiking muscles under the constellations.  The hot tub is up by the pool and is your private hot tub. Cabin 2 has their own hot tub.

PRIVACY: Everyone asks because our cabins and property is sexy sexy (did I mention sexy?) and everyone who books returns! We have set up DTJT so you have privacy. You have your own private outdoor space with a propane firepit and an outdoor wood burning fire stove.  The other cabin on the property has their own private area and neither can see each other! 

DTJT House 1 offers a lovely, insanely comfy king size bed, full kitchen with eating area, comfy stools and a private bathroom. 

The kitchen has basic cookware and utensils (please feel free to bring anything special you might want to use.), a french press, water boiler, Brita water pitcher, along with coffee from Joshua Tree Coffee Co, tea, oatmeal, olive oil and basic seasonings as well as a few snacks if you get the munchies. 

There is a full size oven to bake a turkey in as well as a toaster oven.

We have a wall heater/AC and the bed heats as well. Options! 

There''s also a private outdoor shower that all guests have access to day and night, in addition to the shower and bath in your cabin.

If you bring your pet, please let us know prior to booking. We have coyotes. You assume all risk and there is an extra fee.

Please note, if you’re staying 5 or more days you can use the washer and dryer. 

IF THIS CABIN IS BOOKED DURING YOUR IDEAL DATES, there is a second, private cabin on the property. Please check out  DTJT HOUSE 2.
 It''s quite baller!

Guest access
SHARING THE POOL: In the hot months, you will most likely share the pool with 1-2 other people from the other cabin. The pool is huge. Bigger than most if not all Palm Springs hotel pools! There are two shade structures with tables and chairs.  We find that most of our guests come for special occasions and value their privacy. We set it up for just that. We also find that there is little overlap because people have very different schedules. And even if you do overlap, the pool is effen huge! You''ll be fine.  Where else are you going to have a 50 foot salt water pool for these ideal prices? Spoiler alert. Nowhere. 

You each have your own hot tub! 

You do not have access to the other cabin, unless invited by the other guest(s). 

You DO NOT have access to the main/front house. This includes the front house fire pit, porch or surrounding areas/parking. There are cameras.

Other things to note
We built this place for you to enjoy. By coming here you are part of a community of people from all over the world that appreciate the houses. 

ANIMAL LIFE:
-We ask you not to eat in bed. It''s cool and sexy in the movies, but not so much in the desert. Unless you like ants. In your pants. Which I don''t. 

-You won''t see a snake. That doesn''t mean they''re not there. They don''t like humans. They''re the original quarantiners. 

-We have lots of jack rabbits and bunnies. Drive slow. You''ll feel like garbage if you hit a rabbit and it will most likely ruin your trip. Unless you''re a sociopath. No judgement. 

-Spiders and scorpions. Ew. I know I''m supposed to love all nature, but ew. An exterminator comes regularly. Not because I have lots of creatures, but because I don''t want to see any of them inside. Ever. 

-Coyotes – They’re around. All the time. You’ll hear them at dusk. Don’t feed them or interact with them. Seriously. If you did happen to bring a pet, DO NOT leave the doors open. You won’t have a pet in the morning. 

-Keep your eye out for our resident roadrunner (meep meep!) and keep your ears open for our great horned owl. It’s not your partner snoring.


DON''T BURN DOWN THE DESERT:
- You have two choices for an outdoor fireplace. One is wood burning and the other is proprane.  BYO wood. DO NOT EVER  leave the fire unattended and make sure that the fire is fully extinguished before you leave or fall asleep.

-No smoking inside. 

RANDOM:
-No additional guests to the swimming pool unless you pay an extra fee. It''s not fair to the other guests in Cabin 2. They have the same pool rules. 

-That said, please request beforehand if you want to bring an extra guest. We''re a more chill, laid back vibe and not an MTV spring break sort of place. You get it. 

- Be loving, mindful and filled with deep respect for ALL animals and nature.  If this is not taken into action you will be asked to leave and you will not be refunded.

Registration number
CESTRP-2020-01201
