20minutes from Algodones
24 minutes to AZ State Prison Complex
35 minutes to San Luis Mexico

The Golden Nugget offers a central location to a variety of destinations in Yuma. Ideal for traveling professionals looking for a clean and fully equipped home for their stay. 

The pool at The Golden Nugget is a refreshing added bonus for lounging during your stay, with the Yuma weather the pool is available year-round. 

The Golden Nugget is near a great walking path. Great for a morning run or an afternoon stroll. 

Let us make your stay a memorable one at 
The Golden Nugget!!

Guest access
As a guest you will have access to a full kitchen, living room, dining room and a large backyard with a refreshing pool. You will share these spaces with other guests staying in the additional rooms.
